import React from 'react';
import './main.css';

export default class Main extends Component {
    state = {
        titulo: "Game Fifteen",
        box: []
    }

    render() {
        return (
            <div className="border">
                <h1>
                    {this.state.titulo}
                </h1>
            </div>
        )
    }
}
